    type: PLAN REF
  entry_date: '1995-02-17'
  status: Current
  template_text: "The land has the benefit of the following rights granted by but\
    \ is subject to the following rights served by a *DT**DE* dated *DD* made between\
    \ (1) Morley Arthur Joslin Sexton and (2) Charles William Hallett and Rosemary\
    \ Hallett:-\r\r\"TOGETHER WITH the benefit of all rights reserved to in the First\
    \ Schedule hereto BUT EXCEPTING AND RESERVING unto the Vendor and his successors\
    \ in title the rights specified in the Second Schedule hereto\r\r<UNREADABLE></UNREADABLE>\r\
    \r<CENTRE>THE FIRST SCHEDULE referred to above</CENTRE>\r\r(a)  the right to connect\
    \ to with and take a supply from all water pipes and electric cables laid within\
    \ Eighty years from the date hereof in over or upon the Vendors retained land\
    \ (shown for the purpose of identification only edged blue on the plan annexed\
    \ hereto\r\r(b)  The right to lay a line of pipes and construct a septic tank\
    \ and soakaway and land drain leading therefrom in the approximate position shown\
    \ coloured green on the plan annexed hereto\r\r(c)  The right to enter on to the\
    \ Vendors retained land for the purpose of maintaining repairing renewing and\
    \ replacing the said pipes drains and cables the Purchasers doing no unnecessary\
    \ damage and making good forthwith all damage occasioned by the exercise of such\
    \ rights and PROVIDED FURTHER that the Purchasers shall make good the surface\
    \ of the said retained land of the Vendor to its present condition for agricultural\
    \ purposes\r\r<UNREADABLE></UNREADABLE>\r\r(e)  The right to enter on to the Vendors\
    \ retained land for the purpose of maintaining such buildings as are erected or\
    \ may be erected on the property hereby conveyed and which immediately adjoin\
    \ the Vendors retained land the Purchaser making good any damage caused in the\
    \ exercise of such rights\r\r<UNREADABLE></UNREADABLE>\r\r<CENTRE>THE SECOND SCHEDULE\
    \ above referred to</CENTRE>\r\r<CENTRE>Exceptions and Reservations</CENTRE>\r\
    \r1.  The Vendor reserves the full and free right within Eight years from the\
    \ date hereof for the owner of occupiers for the time being of the Vendors retained\
    \ property not hereby conveyed to enter upon the property hereby conveyed and\
    \ to lay and connect to such wires cables pipes drains and sewers under the property\
    \ hereby conveyed as are necessary for the supply of electricity water telephone\
    \ and other domestic services and for the disposal of water and sewage for the\
    \ beneficial enjoyment of such buildings as are or may be erected on the remainder\
    \ of the Vendors retained property with the right forever thereafter to use the\
    \ same\r\r2. There is also reserved a right of entry for repair and maintenance"
