- entry_id: '2014-07-01 17:14:34.293845'
  role_code: SSCH
  language: ENG
  sub_register: S
  deeds:
  - date: '1811-01-08'
    description: Conveyance
  status: Current
  template_text: "The following are details of the covenants contained in the *DT*\
    \ dated *DD* referred to in the Charges Register:-\r\r\"AND the said William Culverwell\
    \ doth hereby for himself his heirs and assigns covenant promise and agree to\
    \ and with the said James Arthur Keeling his heirs and assigns by these presents\
    \ in manner following that is to say that no stable or Coach house shall be built\
    \ on the said Plot of ground which shall extend more than twenty feet from the\
    \ Eastermost End of the said Plot of ground or be more than twenty feet above\
    \ the level of the intended Road or way to be made behind the said Plot of Ground\
    \ hereby granted and released under such direction as before mentioned AND that\
    \ the same Stable or coach house shall not have any flue for carrying smoke therein\
    \ AND ALSO that no such Stable or coach house or any part thereof shall ever be\
    \ converted into a dwellinghouse Lodging Room or dwelling apartment nor shall\
    \ the same or any part thereof be used for any other purpose than as a stable\
    \ and coachhouse nor shall any person or persons be permitted to reside or dwell\
    \ therein or use the same in any manner ALSO that the whole westward front of\
    \ the said stable or coach house shall be built with freestone properly coombed\
    \ down and in uniformity with other stables and coach houses built or to be built\
    \ at or on the Eastward end of gardens of houses forming the said new site of\
    \ buildings called or intended to be called Cavendish Place and under the direction\
    \ of the said William Broom and James Chapman their several heirs or assigns and\
    \ that such stables and caochhouses shall be wholly covered with blue slate AND\
    \ ALSO that he the said WILLIAM CULVERWELL his heirs appointees or assigns shall\
    \ and will completely finish the said messuage or dwellinghouse and buildings\
    \ hereby released agreeable to all and every the covenants herein contained so\
    \ as to make the said messuage and buildings properly tenantable in evry respect\
    \ on or before the thirty first day of December next AND ALSO that the said William\
    \ Culverwell his heirs or assigns shall and will from time to time and at all\
    \ times hereafter at his or their or some or one of their own proper costs and\
    \ charges effectually lastingly and substantially repair maintain uphold amend\
    \ and keep the said messuage or dwelling house now erected and built or now erecting\
    \ and building on the plot of ground hereby intended to be granted and released\
    \ and all other erections and building which shall or may be erected on the same\
    \ plot of ground or any part thereof pursuant to any covenant therein contained\
    \ with all appurtenances thereto belonging and all windows pavements Garden or\
    \ Boundary walls gutters vaults and houses of office thereto belonging in by and\
    \ with all manner of good lasting and substantial reparirs and amendments whatsoever\
    \ AND ALSO that it shall and may be lawful to and for the said James Keeling his\
    \ heirs or assigns his or their nominees or agents at his or their free will and\
    \ pleasure with or without workmen or others at any convenient time in the day\
    \ time not exceeding twice in any one year into and upon the said plot of ground\
    \ and dwellinghouse hreby released or into the said Vault and area or any part\
    \ thereof or any building erected or to be erected on any part of the said plot\
    \ of ground to enter and come and then and there to view search and see the state\
    \ and condition of the Reparations of the same and of all such default pf reparations\
    \ as shall be then and there found to give or leave notice or warning in writing\
    \ to the said William Culverwell his heirs or assigns or at or on the aforesaid\
    \ messuage so erected or to be erected to repair the same and that within six\
    \ calendar months from and after the time of such notice or warning left at the\
    \ said William Culverston his heirs or assigns shall and will well and effectually\
    \ substantially and lastingly repari and amend the same accordinly AND ALSO that\
    \ in case the said messuage or dwelling house and building so erected and to be\
    \ so completed on the Plot of ground hereby granted and released shall at any\
    \ time hereafter be burnt destroyed or damaged by fire lightening tempest civil\
    \ or foreign emenies or by any other cause or means he the said William Culverwell\
    \ his heirs or assigns shalll and will erect and build the same at his or their\
    \ own costs so soon as may be and at the most within two years after such fire\
    \ or other accident shall have happened in as good lasting and substantial a manner\
    \ and in the same elevation style and order and of as good or greater value than\
    \ the messuage or dwellinghouse and building so destroyed burnt or damaged AND\
    \ ALSO shall and will when the said messuage or dwellnghouse now erecting and\
    \ building on the premises hereby conveyed shall be completed and finished forthwith\
    \ Insure and from time to time and at all times for ever hereafter keep the same\
    \ constantly insured from and against any loss or damage by fire in one of the\
    \ Public Insurance Offices against fire at Bath or London to the amount of not\
    \ less than one thousand pounds and duly pay the premium or consideration money\
    \ for such insurance and in case of accident shall happen by fire to the said\
    \ messuage or dwellinghouse so insureed the money payable under and by virtue\
    \ of such insurance shall be paid and such Insurance Office and the Directors\
    \ and proprietors of the same are hereby full authorised to apply the same either\
    \ to the repariing of the damages done by such fire or in erecting any building\
    \ on the same ground than the messuage so burnt injured or consumed by fire as\
    \ aforesaid AND the said William Culverwell for himself his heirs and assigns\
    \ doth agree that such monies shall not be paid or applied to any other purpose\
    \ whatsoever AND ALSO that after the  said messuage and Premises shall be built\
    \ and completed in manner aforesaid he the said William Culverwell his heirs or\
    \ assigns shall not nor will alter or vary in any respect whatsoever the westernmost\
    \ front of the said House nor the Area Stone plinth iron railing or Pavement before\
    \ such western front nor erect any building or erection in or over the said Area\
    \ the sole use whereof is hereby granted save only a Veranda from the Drawing\
    \ room Windows and also save an Arch to lead into the passage only on the Parlour\
    \ floor of the said House from and out of the said Street or place and also save\
    \ Pantries in the said area which shall not be built or erected higher that the\
    \ foot of the base made to support the iron railing in front of the said area\
    \ to the end the same area may be for ever open and the uniformity of Building\
    \ in the fronts of all the dwellinghouses built or intended in the said place\
    \ called Caviendish Place may for ever be preserved AND ALSO shall not nor will\
    \ at any time hereafter erect or raise any boundary or garden walls higher than\
    \ eight feet or lower than six feet but for ever support and maintain all boundary\
    \ and garden walls of the height last mentioned AND ALSO when the said footway\
    \ and pavement below the west front of the said messuage and the iron railings\
    \ and bast stone intended to bound in the Area there shall be completed agreeable\
    \ to the covenants hereinbefore contained he that said William Culverwell his\
    \ heirs appointees or assigns shall and will forever keep all the same pavement\
    \ iron Railings bounding the said Area in the like state and in good and substantial\
    \ repair and condition AND ALSO that no house or office or other building shall\
    \ be ever made in the said vaults or in the said area westward of the said messuage\
    \ AND ALSO that he the said William Culverwell his heirs or assigns shall not\
    \ nor will at nay time hereafter erect or build or permit or suffer to be erected\
    \ or built any office or building whatsoever eastward or behind the said messuage\
    \ which shall extend more than fifteen feet from the present Eastern front of\
    \ the said messuage or which shall be higher than the cills of the lower staircase\
    \ window at present made in the same messuage without the consent in writing of\
    \ the said William Brown and James Chapman their respective heirs or assigns first\
    \ had and obtained nor shall not will make any flue for smoke in any outbuildings\
    \ which shall not be carried up in and to the top of the main Chimney Stack now\
    \ errected in nad for the said house AND ALSO that he the said William Culverwell\
    \ his heirs or assigns shall not nor will use or carry on or in the said Plot\
    \ of ground hereby released or any building thereon nor permit any person or persons\
    \ to use or carry on or within the same the trades of a butcher slaughterman tallow\
    \ chandler melter or tallow marble mason plumber glazier book binder sawyer carpenter\
    \ or any other noisy noisome or offensive trade business or calling whatsoever.\"\
    \r\r<NOTE></NOTE>"
